/* eslint-disable jsx-a11y/anchor-is-valid */
/* eslint-disable @typescript-eslint/no-unused-vars */
import './App.css';
import FirstComponent from './components/FirstComponent';
import SecondComponent from './components/SecondComponent';
import {Destruturing, Category} from './components/Destruturing';
import State from './components/state';

function App() {
  const name:string = 'Benevanio';
  // eslint-disable-next-line @typescript-eslint/no-unused-vars
  interface User{
    name:string;
    age:number;
    id:string;
    work:boolean;

  }
  const user:User = {
    name: 'Benevanio',
    age: 30,
    id: '1',
    work: true
  }
  //say hy
  const message =(name:string): string =>{
    return `Hello usuario ${name}`;
  }
  return (
    <><div className="App">
      <header className="App-header">

        <nav>

          <a href="#">Home</a>
          <a href="#">About</a>
          <a href="#">Contact</a>

        </nav>
      </header>
      <h3>{message.name}</h3>
      <table>
        <thead>
          <tr>
            <th>Nome</th>
            <th>Idade</th>
            <th>Id</th>
            <th>Trabalha</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>{user.name}</td>
            <td>{user.age}</td>
            <td>{user.id}</td>
            <td>{user.work}</td>
          </tr>
        </tbody>
      </table>
      <FirstComponent />
      <SecondComponent name={''} />
      <Destruturing title={'Natureza'} description={'Paisagem'} image={'https://picsum.photos/200'} price={2000} content={'Fotos aleatorias'} />
    </div><State />
    </>
  );
}

export default App;
